CREATE TABLE `purchaseinfo` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `addtime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `catename` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '采购品种',
  `qty` double DEFAULT NULL COMMENT '采购量',
  `unit` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '单位',
  `shplace` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '收货地',
  `level` int(11) DEFAULT NULL COMMENT '采购等级',
  `releasetime` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '更新时间',
  `breedname` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '类型',
  `linkname` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '采购方',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9977 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='采购信息';
